        <div class="banner">
            <div class = "content">
                <h1>URL SHORTENER</h1>
                <p>Snap long URLs into bite size ones</p>
                <form>
                    <input onChange={(e) => {setTextValue(e.target.value)}} placeholder="Insert URL here..." type="text" class="urlfield" value ={textValue}/>
